<script type="text/javascript">
require(['jquery'], function($) {
  function loadResponse(xhr) {
     var blob = new Blob([xhr.response], {type: 'application/pdf'})
     var burl = URL.createObjectURL(blob);
     $("#embedpdf").html('<embed src="' + burl + '" width="${width}" height="${height}" />');
  }

  function loadUrl(baseUrl, pdf) {
   var url = baseUrl + (pdf ? "/thumbnail/pdf" : "/download");
   console.log("Loading " + url);
   var xhr = new XMLHttpRequest();
   xhr.open("GET", url, true);
   // Now set response type
   xhr.withCredentials = true;
   xhr.responseType = 'arraybuffer';
   xhr.addEventListener('load',function(){
     if (xhr.status === 200 && xhr.response.byteLength>0) {
       console.log("Loading success");
       loadResponse(xhr);
     } else {
       if (pdf) {
         console.log("Loading fallback");
         loadUrl(baseUrl, false)
       } else {
         console.log("Loading failed");
         $("#embedpdf").html('Erreur de chargement code ' + xhr.status);
       }
     }
   });
   xhr.send();
  }

  var url = "${linshareURL}/linshare/webservice/rest/user/v2/work_groups/${workgroup}/nodes/${uuid}"
  loadUrl(url, true);
});

</script>
